INSERT INTO `api_product` VALUES (1,'أرجيفيت فوكس حبوب','حبوب ارجيفيت Argivit  Focus\r\nيتوفر هذا الدواء على هيئة أقراص تؤخذ بالفم.\r\nيحتوي على تركيبة من الفيتامينات والعناصر الداعمة لصحة الجسم.\r\nيستعمل كمكمل غذائي لدعم وتعزيز وظائف الجسم المختلفة.\r\nمن إنتاج شركة ارجيفيت الدولية (Argivit International).\r\nتحسين قدرة الجسم على إفراز هرمون النمو لتعزيز النمو وزيادة الطول.\r\nدعم الجسم بأهم العناصر اللازمة لنموه بصحة خلال فترات الطفولة وقبل البلوغ. \r\nيساعد على الطول من سن ١١ ل ٢٢ سنة\r\nوفي حالات نادرة ٢٥ (وهي حالات تأخر البلوغ)\r\nتوفير عنصر ال ارجينين الذي يعزز من النمو ويزيد الطول.',2500,NULL,70,10,'2024-11-18 20:14:34.913002',1,1,'images/cropped-image-1732355745289.jpeg','images/cropped-image-1732355768685.jpeg','images/cropped-image-1732355780487.jpeg','',1),(2,'شراب أرجيفيت فوكس','شراب ارجيفيت فوكس Argivit  focus \r\nللآطفال  من سن ٥ ل ١١ سنة \r\nيتوفر هذا الدواء على هيئة شراب تؤخذ بالفم.\r\nيحتوي على تركيبة من الفيتامينات والعناصر الداعمة لصحةالذاكرة والتركيز.\r\nيستعمل كمكمل غذائي لدعم وتعزيز وظائف الجسم المختلفة.\r\nمن إنتاج شركة ارجيفيت الدولية (Argivit International).\r\nتحسين قدرة الجسم على انتاج  الهرمونات الداعمة  لتعزيز قدرة الدماغ وزيادة التركيز وفتح الشهية ويساعد ايضا على تعزيز نمو الطول.\r\nدعم الجسم بأهم العناصر اللازمة لنموه بصحة خلال فترات الطفولة وقبل وبعد البلوغ.\r\nتوفير عنصر ال ارجينين الذي يعزز من النمو ويزيد الطول والنمو والتركيز.',2600,2300,19,5,'2024-11-19 09:13:37.149343',1,1,'images/Argivit-Focus-Syrup_aexP7XU.webp','images/71M6xeUJYiL._AC_SY879_.jpg','','',6),(3,'عشبة المورينجا المعجزة لصحة الأعصاب','مستخلص المورينجا الطبيعي – القوة الفائقة من الطبيعة\r\n\r\nاكتشف قوة المورينجا، الشجرة المعروفة بـ \"شجرة الحياة\"، والتي تقدم لك فوائد صحية مذهلة بفضل محتواها الغني بالفيتامينات، المعادن، ومضادات الأكسدة. يتم استخراج هذا المستخلص الطبيعي بعناية ليوفر لك تجربة صحية لا تضاهى.\r\n\r\nالفوائد الرئيسية:\r\n\r\nمضاد للأكسدة: يحارب الجذور الحرة ويساهم في تقوية جهاز المناعة.\r\nمصدر غني بالفيتامينات والمعادن: يحتوي على فيتامين C، فيتامين A، الكالسيوم، والبوتاسيوم لتعزيز الصحة العامة.\r\nتحسين الهضم: يساعد في تعزيز وظائف الجهاز الهضمي وتقليل الالتهابات.\r\nداعم للطاقة والنشاط: يعمل على تحسين مستويات الطاقة وزيادة النشاط البدني والعقلي.\r\nعناية بالبشرة والشعر: يساعد في تجديد خلايا البشرة وتغذية الشعر بفضل خصائصه المغذية.\r\nطريقة الاستخدام: يمكنك تناوله كمسحوق، كبسولات، أو إضافته إلى مشروباتك اليومية مثل العصائر أو الشاي للاستفادة من خصائصه الطبيعية.\r\n\r\nالمنتج المثالي لكل من يبحث عن تعزيز صحته بطريقة طبيعية وآمنة.',500,400,28,3,'2024-11-19 09:37:24.330196',3,1,'images/IMG_3194.png','images/IMG_3195.png','images/IMG_3191.jpeg','',3),(5,'الكورس كامل ٣ علب','ارجيفيت فوكس حبوب الكورس كامل\r\n.\r\nحبوب ارجيفيت Argivit  Focus\r\nيتوفر هذا الدواء على هيئة أقراص تؤخذ بالفم.\r\nيحتوي على تركيبة من الفيتامينات والعناصر الداعمة لصحة الجسم.\r\nيستعمل كمكمل غذائي لدعم وتعزيز وظائف الجسم المختلفة.\r\nمن إنتاج شركة ارجيفيت الدولية (Argivit International).\r\nتحسين قدرة الجسم على إفراز هرمون النمو لتعزيز النمو وزيادة الطول.\r\nدعم الجسم بأهم العناصر اللازمة لنموه بصحة خلال فترات الطفولة وقبل البلوغ. \r\nيساعد على الطول من سن ١١ ل ٢٢ سنة\r\nوفي حالات نادرة ٢٥ (وهي حالات تأخر البلوغ)\r\nتوفير عنصر ال ارجينين الذي يعزز من النمو ويزيد الطول.',7500,6000,56,5,'2024-11-25 12:47:57.374905',1,1,'images/cropped-image-1732538764890.jpeg','images/cropped-image-1732539029751.jpeg','images/cropped-image-1732539052098.jpeg','',2),(6,'الشيلاجيت بودر لدعم القوة والتحمل','استُخرج الشيلاجيت من أعلى مصدر في العالم من جبال الهملايا من ارتفاع يزيد عن 5000 متر ويعد أفضل مكمل غذائي وهو النباتات المتحللة عبر ملايين السنوات تحتوي على حمض الفولفيك وحمض الهيوميك ويحتوي على ٨٥٪ معادن يدخل على الخلايا ويعمل على تجديدها وينظفها من السموم ويزودها بالمعادن والفيتامينات ويعمل على تقليل نسبة السكر في الدم وزيادة الرغبة الجنسية لدى الرجال والنساء ويحارب الشيخوخة ويزيد مناعة الجسم.\r\n\r\nيحتوي الشيلاجيت على: المعادن Ca ، K ، Mg ، Na ، Fe ، Cr ، Rb ، Ba ، Al ، Cs ، Ph ، Zn وغيرها؛ ويحتوي الشيلاجيت على أكثر من 10 أحماض أمينية. يساعد في علاج داء الزهايمر، حيث يمنع الشيلاجيت تقدم المرض بسبب محتواه من مركب مضاد للأكسدة يدعى حمض الفولفيك والذي يمنع تراكم بروتين (Tau) وهو البروتين المسؤول عن حدوث أذية الخلايا الدماغية في داء الزهايمر. يزيد من مستويات التستوستيرون عند الرجال مما يعزز الرغبة الجنسية ويمنع تساقط الشعر وفقدان الكتلة العضلية لديهم. بسبب غنى الشيلاجيت بمعدن الحديد فهو يساعد في علاج فقر الدم، مما يساعد في رفع مستويات الحديد في الدم. يزيد الخصوبة عند الرجال بسبب زيادة كمية النطاف لديهم وزيادة قدرتها على الحركة ويزيد من الحيوانات المنوية بنسبة 55% خلال 3 أشهر.',1100,NULL,10,2,'2024-11-30 07:29:32.299297',3,1,'images/cropped-image-1732951918730.jpeg','images/cropped-image-1732951943345.jpeg','images/cropped-image-1732951966755.jpeg','images/cropped-image-1732952075870.jpeg',7),(10,'كريا باور مونوهيدرات    50  إسكوب','كرياتين مونوهيدرات - قوة أكتر وأداء أفضل\r\n\r\nلو عايز تحسّن أدائك الرياضي وتزوّد قوتك العضلية، الكرياتين مونوهيدرات هو الخيار الأمثل ليك! الكرياتين من المكملات الشهيرة اللي بيستخدمها الرياضيين عشان يعزّزوا أدائهم، يبنوا عضلات أقوى، ويتعافوا بسرعة بعد التمرين.\r\n\r\nالفوايد الرئيسية:\r\n\r\nزيادة القوة والقدرة على التحمل: الكرياتين بيساعد على زيادة مستوى الفوسفات في العضلات، وده بيخليك تقدر تمارس تمارين أكتر وبقوة أكبر.\r\nتحفيز نمو العضلات: الكرياتين بيزود كمية المياه في العضلات، وده بيساعد على زيادة حجم العضلات وبيخليك تحس بفرق في الضخامة.\r\nتحسين الأداء الرياضي: بيحسّن الأداء في التمارين المكثفة والأنشطة اللي بتحتاج قوة سريعة زي رفع الأثقال أو الجري السريع.\r\nالتعافي بسرعة: بيقلل التعب اللي بتحس بيه بعد التمرين، وبيساعد العضلات تتعافى أسرع.\r\nليه تختار كرياتين مونوهيدراتنا؟\r\n\r\nنقاء 100%: الكرياتين نقي خالص من أي إضافات أو مواد حافظة.\r\nسهل الاستخدام: بييجي على شكل مسحوق يذوب بسهولة في الميه أو العصير.\r\nمناسب لكل الرياضيين: سواء كنت بتمارس رياضة رفع الأثقال، الجري، أو أي رياضة عنيفة، الكرياتين هيدعم أدائك بشكل ملحوظ.\r\nطريقة الاستخدام:\r\n\r\nالجرعة الموصى بها: 5 جرامات في اليوم. يفضل تناوله قبل أو بعد التمرين. ممكن تخلطه مع مية أو عصير.\r\nاختار كرياتين مونوهيدرات دلوقتي وابدأ في تحسين أدائك وبناء عضلاتك بشكل أسرع وأفضل!',1000,800,10,2,'2024-12-21 08:08:55.081298',4,1,'images/كرياباور_منتج١.png','images/كريا_باور_٢.png','images/465779438_1083955079799387_5391630472724814652_n.jpg','',4),(12,'NOVOGEN Mass Gainer','The best formula to reach your weight and muscle mass targets.\r\n\r\nEach serving contains 50g of high-quality protein that your muscles need to grow and recover, 252g carbohydrates, and 1250 calories which acts as your body’s main energy source to fuel your muscles and the essential multivitamins needed for your overall health.\r\n\r\nSuggested Use:\r\n\r\nAdd 2 scoops to a shaker cup filled with 700 ml of water and shake till the powder is completely dissolved.\r\nConsume Novogen Mass Gainer between meals, post-workout, and before bed time. For best results, combine with a diet and exercise program.',2800,2500,10,2,'2024-12-25 13:16:49.681947',4,1,'images/mass_gainer.png','images/c1655b96-ed3b-46a6-9efe-0529c485222a-595x595.jpg','images/1db5e811f9ad800c109f70fc1fb50ecb391188a010ddc2251ad563c7e8ac3207.jpg.webp','',5),(13,'NOVOGEN Whey Protein 30 scoop','t is made with the purest cross-flow micro and ultra-filtered whey protein isolate, as the primary source of protein. It designed for all athletes and bodybuilders who are looking for more muscle gain, strength, and better performance. It is also a perfect high-protein meal replacement option for individuals seeking a healthy and nutritious alternative to standard diets and to support overall wellness. Protein is the building block of muscles and is essential for muscle repair and growth after exercise.\r\n\r\nSuggested Use:\r\n\r\nAdd one rounded scoop to a shaker cup filled with 200 ml of water or your favourite beverage, then shake until the powder is completely dissolved.\r\n\r\nDrink one to three servings daily or as needed to satisfy your protein or muscle-building requirements for best results, combine with a diet and exercise program.',1800,1600,10,2,'2024-12-25 14:23:06.994128',4,1,'images/whey.png','images/Novogen_Pharma_Whey-60Serv.jpeg','','',8);
